import React from 'react';

function FoodCards({foodName, estimatedPrice, image}) {

    return (
        <div id="food-cards">
            <div id="food-cards-name">
                <p>{foodName}</p>
            </div>
            <div id="food-cards-image">
                <img src={image} alt="recipe pic"></img>
            </div>
            <div id="food-cards-price">
                <p>{estimatedPrice}</p>
            </div>
        </div>
    );
}

export default FoodCards;
